import React, {useEffect} from 'react';
import'./PopupEditPage.css';
import L from "leaflet";
import "leaflet/dist/leaflet.css";

function PopupEditPage(){

  useEffect(() => {
    var map = L.map("map_page", {
      center: [51.505, -0.09],
      zoom: 13
    });
    L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png?{foo}", {
      foo: "bar",
      attribution:
        'Map data &copy; <a href="https://www.openstreetmap.org/">OpenStreetMap</a> contributors, <a href="https://creativecommons.org/licenses/by-sa/2.0/">CC-BY-SA</a>'
    }).addTo(map);
  }, []);

  return(
    <div className="popup-edit-page">
      <div className="popup-edit-page-container">
        <div className="map-container">
          <div id="map_page" className="map_page"></div>
        </div>
      </div>
    </div>
  )
}

export default PopupEditPage;
